script: |
  super -f text -I q634.spq | sort > q634.out

inputs:
  - name: q634.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( - 65 ) BETWEEN col2 * + col0 AND col1 - + + CAST ( NULL AS INTEGER );
  - name: tab1

outputs:
  - name: q634.out
    data: |
      51	14	96
      85	5	59
      91	47	68
